import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import home from './Home';
import restauranteMenu from './RestauranteMenu';


const Stack = createStackNavigator();
export default function HomeStack({ navigation }) {
  var restaurante = '';
  console.log(navigation.state.params)
  if (navigation.state.params) {
    restaurante = navigation.state.params.restaurante;
  }
  return (
    <NavigationContainer>
      <Stack.Navigator initialroute={'Restaurantes'}>
        <Stack.Screen name="Home" component={home} initialParams={{ restaurante: restaurante }} />
        <Stack.Screen name="Pratos" component={restauranteMenu} initialParams={{ restaurante: restaurante }} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
